    @Test
    public void diferencaEntreverdeVaiParaOEstagioIndispensavel() throws IOException {
        inicioExecucao = new DateTime(2017, 1, 17, 7, 0, 0);

        assertTrue(controlador.isCompleto());

        Motor motor = new Motor(controlador, inicioExecucao, this);

        Anel anel = controlador.findAnelByPosicao(2);
        Pair<Integer, TipoDetector> detector = getDetector(anel, 3);

        avancarSegundos(motor, 161);
        motor.onEvento(new EventoMotor(inicioExecucao.plusSeconds(161), TipoEvento.ACIONAMENTO_DETECTOR_PEDESTRE, detector, 2));
        avancarSegundos(motor, 500);

        int offsetEstagio = 188;
        int numeroAnel = 2;
        assertEquals("E2", 2, listaEstagios.get(inicioExecucao.plusSeconds(offsetEstagio)).get(numeroAnel).getEstagio().getPosicao().intValue());

        verificaHistoricoGruposSemaforicos(offsetEstagio, new GrupoCheck(numeroAnel, 9, 0, 34000, EstadoGrupoSemaforico.VERDE));
        verificaHistoricoGruposSemaforicos(offsetEstagio, new GrupoCheck(numeroAnel, 10, 0, 34000, EstadoGrupoSemaforico.VERMELHO));

        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(numeroAnel, 9, 0, 4000, EstadoGrupoSemaforico.AMARELO));
        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(numeroAnel, 9, 4000, 6000, EstadoGrupoSemaforico.VERMELHO_LIMPEZA));
        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(numeroAnel, 9, 6000, 12000, EstadoGrupoSemaforico.VERMELHO));

        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(numeroAnel, 10, 0, 6000, EstadoGrupoSemaforico.VERMELHO));
        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(numeroAnel, 10, 6000, 12000, EstadoGrupoSemaforico.VERDE));

        offsetEstagio = 200;
        assertEquals("E1", 1, listaEstagios.get(inicioExecucao.plusSeconds(offsetEstagio)).get(numeroAnel).getEstagio().getPosicao().intValue());

        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(numeroAnel, 9, 0, 11000, EstadoGrupoSemaforico.VERMELHO));
        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(numeroAnel, 9, 11000, 43000, EstadoGrupoSemaforico.VERDE));

        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(numeroAnel, 10, 0, 10000, EstadoGrupoSemaforico.VERMELHO_INTERMITENTE));
        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(numeroAnel, 10, 10000, 11000, EstadoGrupoSemaforico.VERMELHO_LIMPEZA));
        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(numeroAnel, 10, 11000, 43000, EstadoGrupoSemaforico.VERMELHO));
    }

